import React from "react";
import "./Usercard.css";

const Usercard = ({ user }) => {
  user.map((curele) => {
      return(
    <>
      {/* <div className="col-md-6">
                <img src={user.avatar_url} alt="Image" />
            </div> */}
      <div className="col-md-6">{curele.name}</div>
    </>);
  });
};

export default Usercard;
